import React from 'react';
import { BrowserRouter as Router, Routes, Route, Navigate, useLocation } from 'react-router-dom';
import { AuthProvider } from './contexts/AuthContext';
import Layout from './components/Layout';
import PrivateRoute from './components/PrivateRoute';

// Pages
import Home from './pages/Home';
import SearchParking from './pages/SearchParking';
import Login from './pages/Login';
import Register from './pages/Register';
import ForgotPassword from './pages/ForgotPassword';

// Driver Pages
import DriverDashboard from './pages/driver/Dashboard';
import VehicleManagement from './pages/driver/VehicleManagement';
import BookingHistory from './pages/driver/BookingHistory';

// Manager Pages
import ManagerDashboard from './pages/manager/Dashboard';
import ParkingManagement from './pages/manager/ParkingManagement';

// Styles
import './styles/index.css';

function App() {
  return (
    <Router>
      <AuthProvider>
        <Routes>
          {/* Auth Routes */}
          <Route path="/login" element={<Login />} />
          <Route path="/register" element={<Register />} />
          <Route path="/forgot-password" element={<ForgotPassword />} />

          {/* Main Layout Routes */}
          <Route element={<Layout />}>
            {/* Public Routes */}
            <Route index element={<Home />} />
            <Route path="/search" element={<SearchParking />} />

            {/* Protected Driver Routes */}
            <Route path="/driver" element={
              <PrivateRoute allowedRoles={['driver']}>
                <DriverDashboard />
              </PrivateRoute>
            } />
            <Route path="/driver/vehicles" element={
              <PrivateRoute allowedRoles={['driver']}>
                <VehicleManagement />
              </PrivateRoute>
            } />
            <Route path="/driver/bookings" element={
              <PrivateRoute allowedRoles={['driver']}>
                <BookingHistory />
              </PrivateRoute>
            } />

            {/* Protected Manager Routes */}
            <Route path="/manager" element={
              <PrivateRoute allowedRoles={['manager']}>
                <ManagerDashboard />
              </PrivateRoute>
            } />
            <Route path="/manager/parking" element={
              <PrivateRoute allowedRoles={['manager']}>
                <ParkingManagement />
              </PrivateRoute>
            } />

            {/* Catch all route */}
            <Route path="*" element={<Navigate to="/" replace />} />
          </Route>
        </Routes>
      </AuthProvider>
    </Router>
  );
}

export default App;
